// src/components/Home.js
import React from 'react';
import './Home.css'; // Style sheet for custom styling

const Home = () => {
  return (
    <div>
      <div className="hero">
        <h1>Welcome to TravelMate!</h1>
      </div>
      <div className="gallery">
        <div className="gallery-item">
          <img src="/images/trip-feature.jpg" alt="Trip Feature" />
          <div className="overlay">Manage and customize trips with ease.</div>
        </div>
        <div className="gallery-item">
          <img src="/images/itinerary-feature.jpg" alt="Itinerary Feature" />
          <div className="overlay">Create detailed itineraries for each trip.</div>
        </div>
        <div className="gallery-item">
          <img src="/images/budget-feature.jpg" alt="Budget Feature" />
          <div className="overlay">Keep track of your travel budget effortlessly.</div>
        </div>
        {/* Add more gallery items as needed */}
      </div>
    </div>
  );
};

export default Home;
